'use strict';

const puppeteer = require('puppeteer');

// The screenshot is returned as a string, which is the base64-encoded representation of the image data.
module.exports = {
        takeScreenshot: async function (html, width, height) {
            return await doTakeScreenshot(html, width, height);
        },
        takeScreenshotEMApp: async function (html) {
            const width = extractSize(html, 'width', 1024);
            const height = extractSize(html, 'height', 768);
            const processedHtml = preprocessHTML(html);
            return await doTakeScreenshot(processedHtml, width, height);
        },
        takeScreenshotEMAppWithCallback: async function (callback, html) { // Used along with Microsoft.AspNetCore.NodeServices, which requires a node-style callback.
            var base64Image;
            try {
                base64Image = await module.exports.takeScreenshotEMApp(html);
            } catch (err) {
                callback(err);
                return;
            }
            callback(null, base64Image);
        }
};

async function doTakeScreenshot(html, width, height) {
    var browser;
    try {
        // Initialize browser instance
        browser = await puppeteer.launch({ args: ['--no-sandbox'] });
        const page = await browser.newPage();
        // Set width and height of image
        await page.setViewport({ width: width, height: height });
        // Load HTML
        await page.setContent(html);
        // Take screenshot and close browser instance
        return await page.screenshot({ encoding: 'base64' });
    } finally {
        if (browser != null) {
            await browser.close();
        }
    }
}

function extractSize(html, type, defaultValue) {
    var wPos = html.indexOf(type);
    if (wPos > 0)
    {
        wPos += type.length + 2;
        var pxIndex = html.indexOf("px", wPos);
        var substring = html.substring(wPos, pxIndex);
        var parsed = parseInt(substring);
        return parsed;
    }

    return defaultValue;
}

function preprocessHTML(html) {
    return (
`
<html>
<head>
<style>
@font-face {
    font-family: 'Roboto-Regular';
    src: url('data:font-woff2;charset=utf-8;base64,') format('woff2')
}

@font-face {
    font-family: 'Roboto-Bold';
    src: url('data:font-woff2;charset=utf-8;base64,') format('woff2')
}

@font-face {
    font-family: 'Roboto-Medium';
    src: url('data:font-woff2;charset=utf-8;base64,') format('woff2')
}
</style>
</head>
<body style='margin:0px; padding:0px;'> 
`
+ html.replace(/<canvas imgsrc/g, "<img src").replace(/\/canvas>/g, "/img>") + 
`
</body>
</html>
`
    );
}
